import React from 'react';
import css from '../App.css';

class TaskCard extends React.Component {
    render() {
        return (
            <div className="card-content" draggable="true" onDrag="ondrag()">
                <div> Task Name</div>
                <div> Task Description</div>
            </div>
        )
    }

    ondrag() {
        alert("drag");
    }
}

export default TaskCard;
